import styled from "styled-components";

const Feed = () => {

	const items = ['to do a','to do b','to do c','to do d'];
	// items.forEach(element => {
	// 	document.write(element + '<br>')
	// })

	return (
		<List>
			<h2> test </h2>
			{items.map((value) => (
				<p> {value} </p>
			))}
		</List>
	);
};

export default Feed;

const List = styled.div`
  display: flex;
  flex-direction: column;
`;
